import { Button } from "@mui/material";

export const TagFilter = () => {
  const [items, setItems] = useState();
  const [artitems, setArtItems] = useState();
  const [photoItems, setPhotoItems] = useState();

  useEffect(() => {
    axios
      .get("http://localhost:3001/api/items/artitems")
      .then((res) => {
        console.log(res);
        setArtItems(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, [setArtItems]);
  useEffect(() => {
    axios
      .get("http://localhost:3001/api/items/photoitems")
      .then((res) => {
        console.log(res);
        setPhotoItems(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, [setPhotoItems]);
  return (
    <>
    <Button>All</Button>
        <Button>Art</Button>
        <Button>Photo</Button>
    </>
  )
}
